import { useEffect } from "react";
import { Navigate, Outlet } from "react-router-dom";

type MyProps = {
  users: boolean;
};

export const ProtectedRoutes = ({ users }: MyProps): any => {
  /* PROTECTED ROUTES */
  useEffect(() => {
    if (!users) {
      <Navigate to={"/"} />;
    } else {
      <Outlet />;
    }
  }, [users]);
};
